import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Container,
  FormGroup,
  Input,
  Form,
} from "reactstrap";
import "./App.css";
import CatButton from "./list/homelist";
import EventMap from "./mapping/eventhome";
import EventNow from "./mapping/eventnow"
import UpcomingEvent from "./mapping/upcomingEvent";

class Body extends Component {
  render() {
    return (
      <Container>
        <br></br>
        <br></br>
        <Form inline>
          <FormGroup style={{ width: "95%" }}>
            <Input
              name="search"
              id="exampleEmail"
              placeholder="Cari..."
              style={{ width: "100%" }}
            />
          </FormGroup>
          <Button>Cari</Button>
        </Form>
        <br></br>
        <br></br>
        <h1 style={{ textAlign: "left" }}>Category</h1>
        <br></br>
        <CatButton />
        <br></br>
        <br></br>
        <br></br>
        <h1>Today</h1>
        <EventNow />
        <h1>Upcoming Event</h1>
        <UpcomingEvent />
      </Container>
    );
  }
}

export default Body;
